run {
  some disj wb, we: Workstation, h1: Human, r1: Robot, c1: Component |
    // universe of sigs
    Workstation = wb + we
    and begin = wb
    and end = we
    and Human = h1
    and Robot = r1
    and Worker = Human + Robot
    and Material = none
    and Component = c1
    and Product = Component + Material
    and Dangerous = none
    // workers per workstation
    and Workstation.workers = wb->h1 + we->r1
    // every component assembled in exactly one workstation
    and Component.workstation = c1->wb
    // parts: components have parts, materials have none
    and Product.parts = c1->c1
    // arbitrary succ
    and Workstation.succ = none->none
} for exactly 2 Workstation, exactly 2 Worker, exactly 1 Product expect 1

