run {
  some disj s: Person, p: Person, c: Course, pr: Project, g0, g1: Grade |
    Person = s + p and
    Student = s and
    Professor = p and
    Course = c and
    Project = pr and
    Grade = g0 + g1 and
    Grade <: next = g0->g1 and

    // only professors teach; every course has a teacher
    Person.teaches = p->c and

    // only students enrolled
    Person.enrolled = s->c and

    // projects proposed by one course and worked by students
    Course <: projects = c->pr and
    Person <: projects = s->pr and

    // only students have grades, in courses they are enrolled, and at most one grade per course
    Course.grades = c->(s->g0)
} for exactly 2 Person, exactly 1 Course, exactly 1 Project, exactly 2 Grade expect 1

